import React, { Fragment } from 'react';
import { BrowseRouter as Router, Route, Switch } from 'react-router-dom';
import './App.css';
import Navbar from './components/layouts/Navbar'
import Landing from './components/layouts/Landing'

const App = () => {
  return (
    <Router>
      <Fragment>
        <Navbar />
        <Landing />
      </Fragment>
    </Router>
  );
}

export default App;
